import React from 'react'
import { Link, animateScroll as scroll } from "react-scroll";

const Menu = () => {
    const front_navbar_items = [
        { name: "Home", icon: "", path: "home" },
        { name: "About me", icon: "", path: "about" },
        { name: "PortFolio", icon: "", path: "portfoilo" },
        { name: "Blog", icon: "", path: "blog" },
        { name: "Contact", icon: "", path: "contact" },
    ]
    return (
        <div className="menu-items d-flex justify-between align-center flex-wrap">

            <div className="menu-item">
                Shop Now
                    </div>
            {
                front_navbar_items.map((item, i) => (
                    <li className={styles.front_nav_item} activeClassName={styles.active} key={i}>
                        <Link
                            className="front_nav_item_name"
                            activeClass="active"
                            to={item.path}
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={500}
                        >
                            {item.name}
                        </Link>
                        {/* <NavLink className="front_nav_item_name" to={item.path}>{item.name}</NavLink> */}
                    </li>
                ))
            }
        </div>
    )
}

export default Menu
